import "./SingleCard.css"

export default function SingleCard({card}){
    return(
        <div className="card">
        <div>
          <img className="front" src={card.src} alt="card front"/>
          <img classsName="back" src="/back.png" alt="card back"/>
        </div>
      </div>
    )
}
